import React from "react";

const Writecontent = () => {
  return (
    <>
      <div className="h-[30%] bg-white mt-6 w-[35%] relative rounded-md shadow-md shadow-slate-400 mx-auto">
        <input
          className="text-xl font-semibold absolute top-3 left-3 outline-0"
          placeholder="Add Input Title"
        ></input>
        <textarea className="text-md absolute top-14 w-[90%] h-[70%] outline-0 ml-4"></textarea>
      </div>
    </>
  );
};

export default Writecontent;
